package com.ciandt.sample.detection.video.visionapi;

import java.awt.Rectangle;
import java.io.BufferedReader;
import java.io.DataOutputStream;
import java.io.InputStreamReader;
import java.net.URL;
import java.util.Base64;
import java.util.Map;

import javax.net.ssl.HttpsURLConnection;
import javax.script.ScriptEngine;
import javax.script.ScriptEngineManager;

import org.opencv.core.Mat;
import org.opencv.core.MatOfByte;
import org.opencv.core.Point;
import org.opencv.core.Rect;
import org.opencv.imgcodecs.Imgcodecs;
import org.json.JSONArray;
import org.json.JSONObject;



public class VisionApi {
	
	private ScriptEngine engine;
	private Rect rectangle;
	
		 
	
	
	  public  String sendImage(Mat img) throws Exception {
		    String json = "";
		    String url = "https://vision.googleapis.com/v1/images:annotate?key=AIzaSyCllsnHYahxHnstOxB37-rYhLOMwyply1I";
		    URL obj = new URL(url);
		    HttpsURLConnection con = (HttpsURLConnection) obj.openConnection();
		    
		    
		    MatOfByte buff = new MatOfByte();
			Imgcodecs.imencode(".jpg", img, buff);
			String imgstr = Base64.getEncoder().encodeToString(buff.toArray());
			  
		
		    //add reuqest header
		    con.setRequestMethod("POST");
	//	    imgstr = "";

		    con.setRequestProperty("Content-Type", "application/json");

		    String urlParameters = "{"
		            + "  \"requests\":["
		            + "    {"
		            + "      \"image\":{"
		            + "        \"content\":\"" + imgstr + "\""
		            + "      },"
		            + "      \"features\":["
		            + "        {"
		            + "          \"type\":\"TEXT_DETECTION\","
		            + "          \"maxResults\":10"
		            + "        }"
		            + "      ]"
		            + "    }"
		            + "  ]"
		            + "}";

		    // Send post request
		    con.setDoOutput(true);
		    DataOutputStream wr = new DataOutputStream(con.getOutputStream());
		    wr.writeBytes(urlParameters);
		    wr.flush();
		    wr.close();

		    BufferedReader in = new BufferedReader(
		            new InputStreamReader(con.getInputStream()));
		    String inputLine;
		    StringBuffer response = new StringBuffer();

		    while ((inputLine = in.readLine()) != null) {
		        response.append(inputLine);
		    }
		    in.close();
		    
		    json = response.toString();
		    
		    JSONObject jsonObject = new JSONObject(json);
		    String text = "";
		    System.out.println(json);
		    JSONArray responses = jsonObject.getJSONArray("responses");
		    if (responses.length() > 0 ){
		    	JSONObject item = responses.getJSONObject(0);
		    	if (json.contains("textAnnotations")){
		    		JSONArray textAnnotations = item.getJSONArray("textAnnotations");
		    		if (textAnnotations.length() > 0 ){
		    			JSONObject subitem = textAnnotations.getJSONObject(0);
		    			text = subitem.getString("description");
		    		//	JSONObject boundingPoly = subitem.getJSONObject("boundingPoly");
		    		//	JSONArray vertices = boundingPoly.getJSONArray("vertices"); 
		    			
		    		//	JSONObject point1 = vertices.getJSONObject(0);
		    		//	JSONObject point2 = vertices.getJSONObject(2);
		    			
		    			
		    		//	rectangle = new Rect(new Point(point1.getDouble("x"),  point1.getDouble("y")),
		    		//			             new Point(point2.getDouble("x"),  point2.getDouble("y")));
		    		}
		    	}
		    }
		    
		    		    
		    if (text.contains("GDE")){
		    	text = text.toLowerCase().replaceAll("vale", "");
		    	text = text.toLowerCase().replaceAll("\n", "");
		    //	text = text.toLowerCase().replaceAll(" ", "");
		    	
		    	return text.toUpperCase();
		    }
		    rectangle = null;
		    return "";
		    
		    
		 

		}




	public Rect getRectangle() {
		return rectangle;
	}




	
}
